                            Description = "С население от над 21 000 000 жители и площ от около 16 801 km² градът е сред най-населените и най-обширните в света\r\n\r\nПекин има статут на град-провинция и граничи с Тиендзин на югозапад и с провинция Хъбей на север, запад и юг. Градът се разделя на 14 окръга – градски и предградия, и две селски общини. От 1949 г. Пекин е столица на Китайската народна република. Той е вторият по население град в страната и е нейният политически, образователен и културен център",
                            Name = "Пекин"
                        },
                        new
                        {
                            Id = 28,
                            CountryId = 16,
                            Description = "Името Сингапур произхожда от санскрит, съставено е от думите синга, сингха и пура, и означава „Лъвски град“. При заселването през 7. – 8. век, тогавашното княжество получава името Темасек („Морски град“), но според легендата то скоро след това било сменено на „Лъвски град“. Причина за това била появата на морско чудовище, наподобяващо лъв. „Мерлион“ – знакът на града – води от там своето начало",
                            Name = "Сингапур"
                        },
                        new
                        {
                            Id = 29,
                            CountryId = 17,
                            Description = "Малдивите са островна държава в Индийския океан, състояща се от група атоли и намираща се на югозапад от Индия и на около 700 км югозападно от Шри Ланка. Те са най-малката азиатска държава и по население, и по територия\r\n\r\nНай-високата им точка е 2,3 метра над морското равнище, а средната им височина е 1,5 м. Общата им площ е 300 км². Столицата се намира на най-големия атол и се нарича Мале. Малдивите нямат нито една река или голямо езеро и се чувства недостига на питейна вода. Температурата на въздуха целогодишно е между 24°C до 33°C",
                            Name = "Мале"
                        },
                        new
                        {
                            Id = 30,
                            CountryId = 18,
                            Description = "Хургада е курортен град в Египет, административен център на мухафаза Червено море. В миналото курортът е бил малко рибарско селище, но сега със своите чисти брегове и рифове се се нарежда сред най-добрите египетски курорти\r\nС повече от 20 км плажна ивица изпъстрена с много хотели, Хургада може да задоволи изискванията на всеки турист. Предлага атракции като гмуркане с акваланг, уиндсърфинг и пустинни сафарита. Хурагда е често посещавана дестинация от руснаци, немци и чехи, както и от други европейски туристи",
                            Name = "Хургада"
                        },
                        new
                        {
                            Id = 31,
                            CountryId = 18,
                            Description = "Сома Бей е крайбрежен курорт на Червено море в Египет, на 45 км южно от международното летище Хургада и на около 28 км северно от пристанището Сафага. Самостоятелната общност от 10 000 000 m² в Сома Бей се намира на полуостров, заобиколен от всички страни от морето",
                            Name = "Сома Бей"
                        },
                        new
                        {
                            Id = 32,
                            CountryId = 18,
                            Description = "Макади Бей е курортен град – част от ривиерата на Червено море, осеян с хотели и спа центрове. Пясъчните плажове са популярни за водолазно гмуркане и гмуркане с шнорхел. В района се предлагат организирани екскурзии, които включват гмуркане в пещери край коралови рифове, както и разглеждане на морски обитатели, като баракуди. Край залива са разположени множество работещи до късно дискотеки и ресторанти, където се предлагат морска храна и кухня от цял свят. Популярните сред семействата атракции включват аквапарк и парка Mini Egypt с модели на известни египетски забележителности",
                            Name = "Макада Бей"
