                            Description = "Свободно време за плаж и забавления или възможност за допълнителни екскурзия: Кайруан и Ел Джем (целодневна екскурзия) - Екскурзията започва с посещение на Кайруан - най-святото за мюсюлманите място в Магреб и 4-ят по святост град за исляма. Ще разгледаме Окба джамия / Голямата джамия, издигната заедно с града през 670 г., и ще се отдадем на шопинг, а след това продължаваме обиколката на Кайруан с посещение на водните резервоари на града – построени преди повече от 1000 години. Продължаваме нашият маршрут до Ел Джем , където се намира най-добре запазения и трети в света амфитеатър. Това е един от най-впечатляващите паметници на световната история и именно той е послужил като декор за заснемането на незабравимия “Гладиатор”. Вечерта се връщаме в хотела",
